import logo from './logo.svg';
import React, { useEffect, useState, Component } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { questions } from "./constants/global"

function App() {
  const [getMessage, setGetMessage] = useState({});
  const [data, setData] = useState({});
  const [count, setCount] = useState(0);
  const [page, setPage] = useState("");
  const [pid, setPid] = useState(0);

  const handleChange = (event,type) => {
    saveInput(type,event.target.value);
  }

  const saveInput = (type,message) => {
    fetch('http://localhost:5000/flask/hello', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        type: type,
        message: message
      }),
    })
      .then((res) => res.json())
      .then((result) => setData(result.rows))
      .catch((err) => console.log('error'))
  }

  useEffect(()=>{
    axios.get('http://localhost:5000/flask/hello').then(response => {
      console.log("SUCCESS", response)
      setGetMessage(response)
    }).catch(error => {
      console.log(error)
    })

  }, [])
  return (
    <div className="App">
      <header className="App-header">
        {page == "" &&
          <div>
            <p><b>Preliminary Questionnaire</b></p>
            <p>Please complete the following questions.</p>
            <p>What is your age?</p>
            <div><input type="radio" onClick={() => saveInput("age","18-24")} name="option" value="age1" id="age1"/> 18-24</div>
            <div><input type="radio" onClick={() => saveInput("age","25-29")} name="option" value="age2" id="age2"/> 25-29</div>
            <div><input type="radio" onClick={() => saveInput("age","30-39")} name="option" value="age3" id="age3"/> 30-39</div>
            <div><input type="radio" onClick={() => saveInput("age","40-49")} name="option" value="age4" id="age4"/> 40-49</div>
            <div><input type="radio" onClick={() => saveInput("age","50-59")} name="option" value="age5" id="age5"/> 50-59</div>
            <div><input type="radio" onClick={() => saveInput("age","60-69")} name="option" value="age6" id="age6"/> 60-69</div>
            <div><input type="radio" onClick={() => saveInput("age","70-79")} name="option" value="age7" id="age7"/> 70-79</div>
            <div><input type="radio" onClick={() => saveInput("age","80 or over")} name="option" value="age8" id="age8"/> 80 or over</div>
            <div><input type="radio" onClick={() => saveInput("age","Prefer not to say")} name="option" value="age9" id="age9"/> Prefer not to say</div>
            <p>What is your gender identity?</p>
            <div><input type="radio" onClick={() => saveInput("gender","man")} name="option1" value="man" id="man"/> Man</div>
            <div><input type="radio" onClick={() => saveInput("gender","non-binary")} name="option1" value="nb" id="nb"/> Non-binary</div>
            <div><input type="radio" onClick={() => saveInput("gender","woman")} name="option1" value="woman" id="woman"/> Woman</div>
            <div><input type="radio" onClick={() => saveInput("gender","other")} name="option1" value="other" id="other"/> Other: <input type="text" onChange={(e) => handleChange(e,"gender-writein")} id="other" name="option1"/></div>
            <div><input type="radio" onClick={() => saveInput("gender","none")} name="option1" value="none" id="none"/> Prefer not to say</div>
            <p>What is your race?</p>
            <div><input type="radio" onClick={() => saveInput("race","american")} name="option2" value="amer" id="amer"/> American Indian or Alaska Native</div>
            <div><input type="radio" onClick={() => saveInput("race","black")} name="option2" value="black" id="black"/>Black or African American</div>
            <div><input type="radio" onClick={() => saveInput("race","white")} name="option2" value="white" id="white"/>White</div>
            <div><input type="radio" onClick={() => saveInput("race","asian")} name="option2" value="asian" id="asian"/>Asian</div>
            <div><input type="radio" onClick={() => saveInput("race","pacific")} name="option2" value="pac" id="pac"/>Native Hawaiian or Other Pacific Islander</div>
            <div><input type="radio" onClick={() => saveInput("race","two")} name="option2" value="mult" id="mult"/>Two or more races</div>
            <div><input type="radio" onClick={() => saveInput("race","none")} name="option2" value="none" id="none"/>Prefer not to say</div>
            <p>Are you Hispanic and/or Latinx?</p>
            <div>
                <input type="radio" name="option3" value="yes" id="yes"/>
                <label htmlFor="yes">Yes</label>
            </div>
            <div>
                <input type="radio" name="option3" value="no" id="no"/>
                <label htmlFor="no">No</label>
            </div>
            <div>
                <input type="radio" name="option3" value="none" id="none"/>
                <label htmlFor="none">Prefer not to say</label>
            </div>
            <br></br>
            <div><input type="button" onClick={() => {setPage("numeracy"); saveInput("type",toString(data))}} name="option" value="Next" id="next"/></div>
          </div>
        }
        {page == "numeracy" &&
          <div>
            <p><b>Preliminary Questionnaire</b></p>
            <p>Please complete the following questions. We will then move on to the main task instructions.</p>
            <p>Imagine that we flip a fair coin 1,000 times. What is your best guess about how many times the coin would come up heads in 1,000 flips?</p>
            <div><input type="text" id="num1" name="num1"/> times out of 1,000</div>
            <p>In the BIG BUCKS LOTTERY, the chances of winning a $10.00 prize is 1%. What is your best guess about how many people would win a $10.00 prize if 1,000 people each buy a single ticket to BIG BUCKS?</p>
            <div><input type="text" id="num2" name="num2"/> person(s) out of 1,000</div>
            <p>In the ACME PUBLISHING SWEEPSTAKES, the chance of winning a car is 1 in 1,000. What percent of tickets to ACME PUBLISHING SWEEPSTAKES win a car?</p>
            <div><input type="text" id="num3" name="num3"/>%</div>
            <br></br>
            <div><input type="button" onClick={() => setPage("instructions")} name="option" value="Next" id="next"/></div>
          </div>
        }
        {page == "instructions" &&
          <div>
            <p><b>INSTRUCTIONS</b></p>
            <p>Next, for each of 30 questions, an AI assistant will provide its prediction and confidence. How the confidence is presented will vary.</p>
            <p>The AI will predict whether you should hit Button A or Button B. You will not be told anything else about Button A or Button B.</p>
            <p>You will have two options: 1) go along with the AI prediction or 2) pass. Each option will offer different amounts of points.</p>
            <p>Your goal is to earn as many points as possible, which will translate into extra money earnings (up to $5).</p>
            <p>Also, after every 10 questions, you will be asked to answer a question or two.</p>
            <br></br>
            <div><input type="button" onClick={() => setPage("attention")} name="option" value="Next" id="next"/></div>
          </div>
        }
        {page == "attention" &&
          <div>
          <p><b>INSTRUCTION QUESTIONS</b></p>
          <p>What is your goal?</p>
          <div>
              <input type="radio" name="option" value="wrong1" id="ans11"/>
              <label htmlFor="agree">To earn at least 15 points over the 30 questions</label>
          </div>
          <div>
              <input type="radio" name="option" value="right1" id="ans12"/>
              <label htmlFor="pass">To earn as many points as possible over the 30 questions</label>
          </div>
          <div>
              <input type="radio" name="option" value="wrong1" id="ans13"/>
              <label htmlFor="pass">To avoid earning zero points on any question</label>
          </div>
          <p>For each question, what will be provided from the AI?</p>
          <div>
              <input type="radio" name="option2" value="wrong2" id="ans21"/>
              <label htmlFor="agree">A prediction</label>
          </div>
          <div>
              <input type="radio" name="option2" value="wrong2" id="ans22"/>
              <label htmlFor="pass">A prediction and explanation for the prediction</label>
          </div>
          <div>
              <input type="radio" name="option2" value="right2" id="ans23"/>
              <label htmlFor="pass">A prediction and confidence in the prediction</label>
          </div>
          <br></br>
          <div><input type="button" onClick={() => setPage("tutorial")} name="option" value="Next" id="next"/></div>
          </div>
        }
        {page == "tutorial" &&
          <div>
            <p><b>PRACTICE QUESTION</b></p>
            <p>The AI predicts that you should select <b>Button A</b>.</p>
            <p>Confidence:</p>
            <img src={require("./images/tutorial.png")} width="200" alt="pie chart confidence display"/>
            <p>Please decide whether to pass or to agree with the AI’s prediction.</p>
            <div>
                <input type="radio" name="option" value="agree" id="agree"/>
                <label htmlFor="agree">Agree with AI (8 points if right; 0 points if wrong)</label>
            </div>
            <div>
                <input type="radio" name="option" value="pass" id="pass"/>
                <label htmlFor="pass">Pass (5 points)</label>
            </div>
            <br></br>
            <div><input type="button" onClick={() => {setPage("question"); setCount(count+1)}} name="option" value="Next" id="next"/></div>
          </div>
        }
        {page == "question" &&
          <div>
            <p><b>QUESTION {count}</b></p>
            <p>The AI predicts that you should select <b>Button {questions[pid][count-1][3]}</b>.</p>
            <p>
            Confidence: {questions[pid][count-1][2].includes("icon") ? <img src={require("./images/"+questions[pid][count-1][2])} width="250" alt="icon array showing 60 black dots and 40 gray dots"/> : questions[pid][count-1][2]}
            </p>
            <p>Please decide whether to pass or to agree with the AI’s prediction.</p>
            <div>
                <input type="radio" name="option" value="agree" id="agree"/>
                <label htmlFor="agree">Agree with AI ({questions[pid][count-1][0]} points if right; 0 points if wrong)</label>
            </div>
            <div>
                <input type="radio" name="option" value="pass" id="pass"/>
                <label htmlFor="pass">Pass ({questions[pid][count-1][1]} points)</label>
            </div>
            <br></br>
            {count < 30 ? <div><input type="button" onClick={() => {setPage("question"); setCount(count+1)}} name="option" value="Next" id="next"/></div> : <div><input type="button" onClick={() => setPage("final")} name="option" value="Next" id="next"/></div>}
          </div>
        }
        {page == "final" &&
          <div>
            <p><b>FINAL QUESTIONS</b></p>
            <p>Examples of each confidence format that you saw are shown below.</p>
            <p>
            {questions[pid][0][2].includes("%") && "Percentage: 60%"}
            {questions[pid][0][2].includes("out") && "Frequency: 60 out of 100"}
            {questions[pid][0][2].includes("icon") && "Icon Array:"}
            </p>
            {questions[pid][0][2].includes("icon") && <img src={require("./images/icon60.jpeg")} width="250" alt="icon array showing 60 black dots and 40 gray dots"/>}
            <p>
            {questions[pid][10][2].includes("%") && "Percentage: 60%"}
            {questions[pid][10][2].includes("out") && "Frequency: 60 out of 100"}
            {questions[pid][10][2].includes("icon") && "Icon Array:"}
            </p>
            {questions[pid][10][2].includes("icon") && <img src={require("./images/icon60.jpeg")} width="250" alt="icon array showing 60 black dots and 40 gray dots"/>}
            <p>
            {questions[pid][20][2].includes("%") && "Percentage: 60%"}
            {questions[pid][20][2].includes("out") && "Frequency: 60 out of 100"}
            {questions[pid][20][2].includes("icon") && "Icon Array:"}
            </p>
            {questions[pid][20][2].includes("icon") && <img src={require("./images/icon60.jpeg")} width="250" alt="icon array showing 60 black dots and 40 gray dots"/>}
            <p>Please list the confidence formats from your most favorite to least favorite. Please do not have any ties.</p>
            <div>
                  <textarea id="rank" name="rank" rows="4" cols="50">
                  Most Favorite:
                  Second Favorite:
                  Least Favorite:
                  </textarea>
            </div>
            <p>Please describe why your favorite is your favorite. (1-2 sentences)</p>
            <div><textarea id="fav" name="fav" rows="4" cols="50"></textarea></div>
            <br></br>
            <div><input type="button" name="option" value="Finish" id="finish"/></div>
          </div>
        }
      </header>
    </div>
  );
}

